import React from "react"
import "./Pricing.css"


const data = [
    {
      employeeId: '01',
      name: 'GST Tool*',
      email: 'NO',
      position: 'YES',
    },
    {
      employeeId: '02',
      name: 'GST Registration',
      email: 'NO',
      position: 'YES',
    },
    {
      employeeId: '03',
      name: 'GST Return Monthly and Quarterly**',
      email: 'NO',
      position: 'YES',
    },
    {
        employeeId: '04',
        name: 'GST Annual Return',
        email: 'NO',
        position: 'YES',
      },
  ]
  
  const Pricing = () => {
    const [employeeData, setEmployeeData] = React.useState(data)
  
    const onChange = (e, employeeId) => {
      const { name, value } = e.target
  
      const editData = employeeData.map((item) =>
        item.employeeId === employeeId && name ? { ...item, [name]: value } : item
      )
  
      setEmployeeData(editData)
    }
  
    return (
      <div className="container">
        <h1 className="title">GST Registraton Pricing</h1>
        <table>
          <thead>
            <tr>
              <th>Services Provided</th>
              <th>Free Plan</th>
              <th>Standard Plan â‚¹6000/- per year</th>
            </tr>
          </thead>
          <tbody>
            {employeeData.map(({ employeeId, name, email, position }) => (
              <tr key={employeeId}>
                <td>
                 {name}
                </td>
                <td>
                 {email}
                </td>
                <td>
                 {position}
                </td>
              </tr>
            ))}
          </tbody>
        </table>
      </div>
    )
  }
  
  export default Pricing;
